import { StyleSheet,Dimensions} from 'react-native';
const warehouseStyle = StyleSheet.create({
    div:{
        backgroundColor:"#fff",
        borderRadius:16,
        width:Dimensions.get('window').width - 40,
    }
});
export {warehouseStyle};
